import React, { useState } from 'react'
import "./Contact.css"
import Navigator from '../Navs/Navigate';
import ContactAnimate from '../Contact/ContactAnimate';

export default function Contact() {
  const [formUpdate,setFormUpdate]=useState(
    {name:"",
    email:"",
    message:"",
  }
  );

    // Handle form submission
    const handleSubmit = (e) => {
      e.preventDefault();
      // Add login logic here (e.g., API call)
      console.log(formUpdate);
    };

    // Handle input changes
    const handleChange = (e) => {
      const { name, value } = e.target;
      setFormUpdate({ ...formUpdate, [name]: value });
    }  

  return (
    <div>
      <Navigator />
      <div className="fset" >
      <div id='contact-Form' className='container'>
        <h2><ContactAnimate /></h2>
      <div class="container mt-5">
        <form id="contactForm" onSubmit={handleSubmit}>
          <div id='name' class="form-group">
            {/* -------------name--------- */}
            <input
              type="text"
              placeholder='Whats your name?'
              class="form-control"
              id="name"
              value={formUpdate.name}
              onChange={handleChange}
              name="name"
              required />
          </div>


          {/* --------Email--------- */}
          <div id='email-sec' class="form-group">
            <input
              type="email"
              placeholder='Enter your email'
              class="form-control"
              id="email"
              value={formUpdate.email}
              onChange={handleChange}
              name="email"
              required />
          </div>

          {/* ----------Message section----------- */}
          <div id='msg' class="form-group">
            <textarea
              class="form-control"
              id="message"
              value={formUpdate.message}
              onChange={handleChange}
              name="message"
              rows="5"
              placeholder='Send us a message'
              required />
          </div>
          <button id='btn' type="submit" class="btn btn-success">SUBMIT</button>
        </form>
        </div>
      </div>
      </div>

    </div>
  )
}
